import React from "react";
// import {Link} from 'react-router-dom'
import { Button, Card } from "react-bootstrap";


import axios from 'axios'
import { useEffect, useState } from "react";

const K = () => {
    const [card, setCard] = useState([])
    useEffect(() => {
        axios.get('http://localhost:3000/photos/get')
        .then((res) => {
            // console.log(res.data.data)
            setCard(res.data.data)
        })
    }, [])
    return (
        <>
        {
            card.map((data, index) => {
                const url = data.PHOTO
                const split = url.split('/')
                const gambar = split[5]
                return(
                    <Card style={{ width: '16rem', height: '12rem' }} key={index}>
                        <Card.Img variant="top" src={`https://drive.google.com/uc?export=view&id=${gambar}`} />
                        {/* <Card.Body className="">
                            <Card.Title>{data.TITLE}</Card.Title>
                            <Card.Text className="d-flex justify-content-between" style={{ width: '220px', overflow: 'hidden', whiteSpace: 'wrap', textOverflow: 'ellipsis' }}>
                            {data.DESCRIPTION}
                            </Card.Text>
                            <Button variant="success" href={`/photo-info/${data.ID}`}>Go Details </Button>
                        </Card.Body> */}
                    </Card>
                )
            })
        }
        
        </>
    )
}

export default K;
